**Description**: This change makes all of the classes backed by native objects extends a new NativeObject class which properly handles the the safe access and execution of native methods. Specifically, any native objects needed for a specific native method must be not closed. Additionally, an object's close method to wait until the last usage of any active reference is completed. Failure to do those things may result in a native method being invoked with closed native handle. Or a native close occurring during an active native execution. I was inspired by tensorflow's JNI https://github.com/tensorflow/tensorflow/blob/master/tensorflow/java/src/main/java/org/tensorflow/Graph.java#L359 Like their implementation, I utilized a lot of try-with-resources. I did not like the amount of locking in their implementation, so I decided to use reference counts using AtomicInteger to ensure consistency using CAS rather than synchronization. I also did some general cleanup:
* Immutable maps and collections.
* Reading session information only at construction time.
* Pre-sizing maps and collections.
* Update gitignore for IDE files.
* Update javadoc config to only show public methods.
* Cleaned up default allocator and session options in OrtEnvironment. This did require moving some OrtAllocator-specific code in the C code to a different file.

***Thread-Safety Description***

Here is some pseudocode of what is going on in NativeObject:

```
class NativeObject {
  constructor() {
  increment referenceCount
  }

  close() {
   if closed do not close again
   decrement referenceCount
   if the new value is greater than zero then some other thread is still using a reference (at least one NativeReference has not been closed) so wait for that last alive one to notify this thread before proceeding
   else the new value is less than or equal to zero, so there are no active references (all instances of NativeReference have been closed) so we do not need to wait
   free up native resources
  }
  
  class NativeReference {
    constructor() {
      increment referenceCount
      if the old value was less than or equal to zero indicating the NativeObject was closed then release() and throw an exception. release() needs to be called to restore the old value by decrementing the referenceCount. also the exception means that close() won't be called.
      else proceed as normal and the release() will be called in the close()
    }
    
    release() {
      decrement referenceCount
      if the new value is zero then this was the last active reference so notify the wait in NativeObject.close()
      else do nothing since NativeObject is still alive
    }
    
    close() {
      release() if NativeReference has not been closed
    }
  }
}
```


**Motivation and Context**
- I intend on using onnxruntime in a multithreaded environment. The session is created in one thread, then a bunch of other threads see the reference to the OrtSession and do model evaluations in those other threads. Periodically, a new model is loaded and a new OrtSession is created. The reference to the active session is swapped out for the new OrtSession, and then that OrtSession would be closed. However the current codebase does not handle this situation gracefully or safely. Inferences could still be occurring in the run() method, when the OrtSession.close() method is invoked. Depending on the interleaving across threads this could produce a segmentation fault. At the minimum, any objects used after closure should throw an exception. And more importantly, the close() method should be able to block until the last usage is complete, while simultaneously locking out any new attempts to use the object.
- I also updated the OrtEnvironment semantics. While in most cases, a single environment is created and used for the duration of the application. I did add the ability to close the OrtEnvironment. In that case, a subsequent call to getEnvironment() would not return the existing environment, but rather a new one.

I use "export OMP_NUM_THREADS=1"  as well as the following code to set the thread num as 1.
g_ort->SetIntraOpNumThreads(session_options, 1);
g_ort->SetInterOpNumThreads(session_options, 1);
When  default provider is used,  using top command to check the cpu usage , "%CPU" is less than or equal to 100.

But when I used the following code to set openvino as the provider
Ort::ThrowOnError(OrtSessionOptionsAppendExecutionProvider_OpenVINO(session_options, ""));
top command show "%CPU"  larger than 100, about 1000~3000.

How to control the CPU useage when openvino is the provider?

**Description**
This PR adds direct support for modern C++ standards to the `Ort::Value` class in the `Experimental` namespace. Specifically it simplifies the `CreateTensor()` functions. so that API callers can focus less on API internal details (like dealing with Ort::MemoryInfo).

@KevinHake Since you commented on my other [PR](https://github.com/microsoft/onnxruntime/pull/4217), I think you might find this contribution helpful too.

**Motivation and Context**
Discussion about this first started [here](https://github.com/microsoft/onnxruntime/issues/4094)

**Code Snippet**
Below is a very basic code snippet to demonstrate how to create a tensor with the new experimental API.

```cpp
#include <algorithm> // std::generate
#include <iostream>
#include <sstream>
#include <vector>
#include <experimental_onnxruntime_cxx_api.h>

// pretty prints a shape dimension vector
std::string print_shape(const std::vector<int64_t> v) {
  std::stringstream ss("");
  for (int i=0; i< v.size()-1; i++)
    ss << v[i] << "x";
  ss << v[v.size()-1];
  return ss.str();
}

int calculate_product(const std::vector<int64_t> v) {
  int total = 1;
  for (auto& i : v) total *= i;
  return total;
}

using namespace std;

int main(int argc, char **argv) {
  if (argc != 1) {
    cout << "Usage: ./onnx-api-example" << endl;
    return -1;
  }
  // Create an Ort tensor of random numbers
  std::vector<int64_t> input_shape = {3,4};
  int total_number_elements = calculate_product(input_shape);
  std::vector<float> input_tensor_values(total_number_elements);
  std::generate(input_tensor_values.begin(), input_tensor_values.end(), [&]{ return rand()%255; }); // generate random numbers in the range [0, 255]
  
  auto input_tensor = Ort::Experimental::Value::CreateTensor<float>(input_tensor_values.data(), input_tensor_values.size(), input_shape);
  cout << "tensor shape: " << print_shape( input_tensor.GetTensorTypeAndShapeInfo().GetShape() ) << endl;
}
```

**Motivation and Context**
The following string tensor APIs `GetStringDataLength`, `GetStringTensorContent` and `FillStringTensor` take as input or return all the elements of a string tensor. The user therefore needs to provide all the inputs before making a call to `FillStringTensor` or get all string tensor elements in one API call. 
In the scenario that the user doesn’t have all the elements before invoking `FillStringTensor` or only wants a to retrieve a single element from the tensor, the user must maintain a cache. The PR adds APIs to support the functionality to get or set individual elements for string tensors as well as their C++ wrappers.

_Note: These changes are as per the discussion with the QAS team and ONNX team (@pranavsharma)_

**Current Changes**: 
1. Add support for the following string tensor C APIs:
  a. GetStringTensorElement: Get a string tensor element by index
  b. GetStringTensorElementLength: Get the length of a string tensor element by index 
  c. FillStringTensorElement: Set a string tensor element by index

2. Add unit tests for the new C APIs: [onnxruntime/test/shared_lib/test_inference.cc](https://github.com/microsoft/onnxruntime/compare/master...alishasonawalla:alsonawa/add_string_tensor_api?expand=1#diff-4e5e75dedcb775edc4d8289a791a47c3)

3. Add C++ wrappers for the new C APIs implemented above as well as for `FillStringTensor` function: [include/onnxruntime/core/session/onnxruntime_cxx_inline.h](https://github.com/microsoft/onnxruntime/compare/master...alishasonawalla:alsonawa/add_string_tensor_api?expand=1#diff-9a156f8eac4f8ebfe60190e6d53a112a) and [include/onnxruntime/core/session/onnxruntime_cxx_api.h](https://github.com/microsoft/onnxruntime/compare/master...alishasonawalla:alsonawa/add_string_tensor_api?expand=1#diff-f85b3061605b759cf381eecf6d33469a)

4. Other fixes/updates
	a. Update bounds check for `FillStringTensor`: [onnxruntime/core/session/onnxruntime_c_api.cc](https://github.com/microsoft/onnxruntime/compare/master...alishasonawalla:alsonawa/add_string_tensor_api?expand=1#diff-17e1b2dcae1d4db70da44b8f6aab38ba)
	The new check verifies if the input array is both shorter or longer than the tensor. In the current scenario if the input array is longer the tensor size the remaining input will be dropped. _Please let me know if this was the planned design._ 
	
	b. Update loop counter for `GetStringTensorContent` to iterate over `len` instead of `offsets_len` in the scenario where offsets_len may be longer than `len` but that is not a bug: [onnxruntime/core/session/onnxruntime_c_api.cc](https://github.com/microsoft/onnxruntime/compare/master...alishasonawalla:alsonawa/add_string_tensor_api?expand=1#diff-17e1b2dcae1d4db70da44b8f6aab38baL575)
	
	c. Update error messages with more description: [onnxruntime/core/session/onnxruntime_c_api.cc](https://github.com/microsoft/onnxruntime/compare/master...alishasonawalla:alsonawa/add_string_tensor_api?expand=1#diff-17e1b2dcae1d4db70da44b8f6aab38baL576)

    d.  Update unit test to use `FillStringTenor` C++ wrapper: [onnxruntime/test/shared_lib/test_inference.cc](https://github.com/microsoft/onnxruntime/compare/master...alishasonawalla:alsonawa/add_string_tensor_api?expand=1#diff-4e5e75dedcb775edc4d8289a791a47c3L445)


**Examples**
```
for (size_t i = 0; i < expected_len; i++) 
{
	tensor.FillStringTensorElement(s[i], i);
}
```
```
const char* s[] = {"abc", "kmp"};

int64_t expected_len = 2;
int64_t element_index = 0;

auto default_allocator = onnxruntime::make_unique<MockedOrtAllocator>();

Ort::Value tensor = Ort::Value::CreateTensor(default_allocator.get(), &expected_len, 1, ONNX_TENSOR_ELEMENT_DATA_TYPE_STRING);

tensor.FillStringTensor(s, expected_len);

std::string result(expected_string_len, '\0');

auto string_len = tensor.GetStringTensorElementLength(element_index);

tensor.GetStringTensorElement((void*)result.data(), string_len, element_index);
```
